INSERT INTO `instrument` (`id`, `nom`, `prix`, `preview`, `description`, `position`) VALUES
(28, 'Eagle Eyes: classique', NULL, 'IMG-0111-removebg-preview-1-63c7ce3fdc3e1.png', 'Classique :\r\n\r\nCette guitare produit un son très timbré avec une grande clarté dans la polyphonie et un bel équilibre. Les basses sont profondes sans jamais\r\ndevenir envahissantes. Les harmoniques sont à la fois riches et sans\r\nagressivité, avec une belle longueur et de la projection.\r\nLa table d\'harmonie en épicéa de tout premier choix est la guarantie d\'une trèsbonne évolution dans le temps. Afin de répondre au mieux aux\r\nbesoins de chaque musicien, elle est disponible en deux modèles:\r\n\r\n\r\nModèle A. Prix: 2 890 €\r\n\r\n-Table d\'harmonie : épicéa du Jura qualité AAA.\r\n-Fond et éclisses : acacia massif.\r\n-Manche : acajou brun avec renfort carbone.\r\n-Touche : ébène.\r\n-Mécaniques : Rubner.\r\n-Filets : celluloïd.\r\n-Cordes : Savarez 500 AJ.\r\n\r\nModèle B. Prix : 3 790€\r\n\r\n-Table d\'harmonie : épicéa du jura qualité AAA.\r\n-Fond et éclisses : noyer ondé/figuré de l\'Isère, qualité \"spéciale\" ou\r\nérable ondé du jura qualité AAA.\r\n-Manche : acajou brun avec renfort carbone.\r\n-Touche : ébène.\r\n-Mécaniques : Rubner.\r\n-Filets : platane maillé.\r\n-Cordes : Savarez 500 AJ.', 1),
(30, 'Archtop', NULL, 'IMG-0117-removebg-63c7d1bf15fb7.png', 'Archtop\r\n\r\nCette guitare Archtop est destinée à être amplifiée. La table et le fond ont été mis en tention par le barrage l\'obligeant à épouser un galbe\r\nimportant. Ce procédé de mise en tention de la table et du fond apporte à la guitare une grande nervosité et rapidité d\'émission.\r\nCela donne un instrument avec d\'excellentes qualités sonores, et notamment des médiums très colorés et \"boisés\".\r\nA la croisée des chemins, elle permet d\'aborder aussi bien le jazz à l\'américaine, le jazz manouche à\r\nla française, ou le rock\'n roll 50\'s. \r\nElle offre une bonne résistance aufeedback, et aussi une bonne projection en acoustique si l\'on désire jouer sans amplification. Elle est donc proposée en deux version, sur\r\nla même base de lutherie:\r\n\r\n\r\nModèle Jazz (un micro). Prix : 3 990€.\r\n\r\n-Table d\'harmonie : épicéa du jura qualité AAA.\r\n-Fond et éclisses : Noyer ondé/figuré de l\'Isère qualité \"spéciale\",\r\nou érable ondé du jura qualité AAA.\r\n-Manche : érable ondé avec trussrod double action.\r\n\r\n-Touche : ébène.\r\n-Repères : laiton.\r\n-Filets : celluloïd.\r\n-Micro : Lace Pickups jazz 251 CP.-\r\n-Cordes : D\'addario Pure Nickel.\r\n\r\nModèle 50\'s (deux micros). Prix : 4 290€\r\n\r\n-Table d\'harmonie : épicéa du jura qualité AAA.\r\n-Fond et éclisses : Noyer ondé/figuré de l\'Isère qualité \"spéciale\" ou\r\nérable ondé du jura qualité AAA.\r\n-Manche : érable ondé avec trussrod double action.\r\n-Touche : ébène.\r\n-Repères : laiton.\r\n-Filets : celluloïd.\r\n-Micros : Lace Pickups jazz 251 CP.\r\n-Cordes : D\'addario Pure Nickel.', 2),
(33, 'Eagle eye: Acoustique', NULL, 'IMG-0114-removebg-preview-63efa4874578f.png', 'Acoustique :\r\n\r\nIl s\'agit ici typiquement d\'une guitare acoustique \"à la française\" avec\r\nune architecture de barrage originale. Il en résulte un son d\'une grande\r\nclarté, avec des médium très chantants et une grande projection, qui en\r\nfont un instrument propice aux jam non amplifiées. C\'est une guitare\r\ntrès polyvalente. Elle est particulièrement à l\'aise dans les styles\r\nfingerpicking, mais se prète aussi bien au jeu médiator. Elle permet\r\nd\'aborder tous les styles d\'accompagnements et le jazz. La table\r\nd\'harmonie en épicéa de tout premier choix est la garantie d\'une très\r\nbonne évolution dans le temps. Elle est proposée en deux versions afin\r\nde correspondre au mieux aux aspirations de chacun:\r\n\r\nModèle A. Prix : 2 990€.\r\n-Table d\'harmonie : épicéa du Jura, qualité AAA.\r\n-Fond et éclisses : acacia massif.\r\n\r\n-Manche : érable ondé avec trussrod double action.\r\n-Touche : ébène.\r\n-Repères : laiton.\r\n-Filets : celluloïd.\r\n-Mécaniques : Rubner.\r\n-Cordes : acier/phosphore-bronze.\r\n\r\nModèle B. Prix : 3 990€.\r\n\r\n-Table d\'harmonie : épicéa du Jura qualité AAA.\r\n-Fond et éclisses : noyer ondé/figuré de l\'Isère, qualité « spécial », ou\r\nérable ondé du Jura qualité AAA.\r\n-Manche : érable ondé avec trussrod double action.\r\n-Touche : ébène ou ziricote.\r\n-Repères : laiton.\r\n-Filets : platane maillé.\r\n-Cordes : Acier/phosfore-bronze.', 3);

