--
-- Structure de la table `section`
--

CREATE TABLE `section` (
  `id` int(11) NOT NULL,
  `titre` varchar(60) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `image` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `text` longtext COLLATE utf8mb4_unicode_ci NOT NULL,
  `position` int(11) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

--
-- Déchargement des données de la table `section`
--

INSERT INTO `section` (`id`, `titre`, `image`, `text`, `position`) VALUES
(3, 'The fisherman', 'Pascal-1-63c7c8504a6b3.jpg', 'Bienvenue sur la vitrine digitale de l\'atelier de lutherie et magasin Doc\'Guitar Shop. Je suis Pascal Pecheur \"The Fisherman\", luthier installé à Chambéry dans le département de la Savoie. Je conçois, fabrique, entretien, révise et répare votre guitare, basse, etc...\r\n\r\nJ’ai commencé à jouer de la guitare classique à 8 ans. Après avoir obtenu un premier prix de conservatoire , je me suis produit régulièrement en récitals de musique classique durant plus d’une décennie.\r\n\r\nJ’ai enseigné en parallèle cette discipline au conservatoire de Perpignan ainsi que dans diverses écoles de musique. J\'ai appris la lutherie enfant avec mon père et c\'est donc tout naturellement que je me suis converti à la lutherie.', 2),
(4, 'Notre Vision', NULL, 'Chez Doc\'Guitar Shop, nous privilégions l\'innovation, la qualité des matériaux, l\'ergonomie, l\'adéquation instrument/répertoire, nous vous guidons dans le choix des bois utilisés afin que chaque instrument sur mesure soit unique et corresponde exactement au souhait du musicien.\r\n\r\nChez nous, tout est possible : guitare électrique, classique, folk, manouche, jazz, basses, ukulélé...', 3),
(5, 'La DOOBAS', 'doobas-63c7c8cfee32a.webp', 'Les contrebassistes déplorent souvent les difficultés à sonoriser leur instrument.\r\n\r\nNous avons tenu compte de leurs remarques et souhaité y répondre avec un instrument optimisé, dont l’électronique a été conçue et conjointement à la lutherie.\r\n\r\nNous l’avons appelée la Doobass ! Il ne s\'agit ici pas d\'un stick qui offre de bonnes performances sonores, mais au final s\'avère trop rigide.\r\n\r\nLa DOOBASS est une véritable contrebasse électrique qui bénéficie de toute la souplesse et l\'élasticité d\'une contrebasse classique.\r\n\r\nIl en résulte des sensations de jeu et un son similaire, ce qui permet au musicien de se sentir immédiatement à l\'aise, comme sur une contrebasse traditionnelle. Sa petite taille et sa solidité permettent de la transporter facilement et de plus, vous pouvez travailler, même sans ampli, sans gêner vos voisins.', 4),
(26, 'A la une !', NULL, 'Nous avons créé la gamme « Eagle eye » après de nombreuses recherches. \r\nNous avons pour cela adaptés nos procédés de fabrication afin d\'optimiser au mieux                                      \r\nl\'utilisation de bois locaux. \r\nNous produisons aujourd\'hui des instruments au design original et aux qualités sonores qui n\'ont rien à envier à ceux produits avec des variétés tropicales\r\nissues le plus souvent d\'exploitation non respectueuses de l\'environnement.\r\n\r\nDans la même démarche, nous avons remplacé tous nos vernis par un traitement avec un mélange d\'huiles siccatives et de résines naturelles.\r\nCe procédé offre plusieurs avantages : Il évite d\'avoir recours à des produits issus de l\'industrie chimique, et à l\'opérateur d\'être exposé aux solvants et autres produits toxiques. \r\nIl permet de sublimer la beauté des bois grâce avec une belle finition naturelle satinée. Il permet à l\'instrument de conserver toutes ses qualités sonores. Il offre une bonne résistance à l\'usage et un toucher parfait.', 1);

